#define E_PTATOFF_2 0x0037
#define E_VDDSCGRAD 0x003E // HS calibration value
#define E_VDDSCOFF 0x003F // HS calibration value
//#define E_GLOBALOFF 0x0054 // global offset, stored as signed char
#define E_MBIT_USER 0x0020 // user settings of trim register 1
#define E_BIAS_USER 0x0021 // user settings of trim register 2 & 3
#define E_CLK_USER 0x0022 // user settings of trim register 4
#define E_BPA_USER 0x0023 // user settings of trim register 5 & 6
#define E_PU_USER 0x0024 // user settings of trim register 7
#define E_ID1 0x003A // sensor idenification number, stored as unsigned long (1 of 4)
#define E_ID2 0x003B
#define E_NROFDEFPIX 0x000E // number of defekt pixel, stored as unsigned char
#define E_DEADPIXADR 0x000F // first register of dead adress
#define E_DEADPIXMASK 0x000E // first register of dead pixel mask
#define E_VDDCOMPGRAD 0x0040 // first register of VDD comp gradient
#define E_VDDCOMPOFF 0x00A0 // first register ofVDD comp offset
#define E_THGRAD 0x0100 // first register of thermal gradient
#define E_THOFFSET 0x0200 // first register of thermal offset 
#define E_PIJ 0x300 // first register of pixel constants (PixC)
